def convertToQuestion(feature):

    if feature.startswith('it_'):
        question = feature.replace("it_", "This_object_", 1)
    elif feature.startswith('has_'):
        question = feature.replace("has_", "Does_it_have_", 1)
    elif feature.startswith('is_'):
        question = feature.replace("is_", "Is_it_", 1)
    elif feature.startswith('was_'):
        question = feature.replace("was_", "Was_it_", 1)
    elif feature.startswith('it\'s_'):
        question = feature.replace("it's_", "Is_it's_", 1)
    elif feature.startswith('for_example_'):
        question = feature.replace("for_example_", "Is_\"")
        question += "\"_an_example_or_version_of_this_object"
    else:
        pass

    question = question.replace("_", " ")
    question += "?"

    return question

lmr = WordNetLemmatizer()
def getWordnetPos(tag):
    if tag.startswith('J'):
        return wn.ADJ
    elif tag.startswith('V'):
        return wn.VERB
    elif tag.startswith('N') or (tag == 'CD'):
        return wn.NOUN
    elif tag.startswith('R'):
        return wn.ADV
    elif tag == 'SAT':
        return wn.SAT_ADJ
    else:
        return "_" + tag.lower()



def interpret(read):
    readTokens = nltk.word_tokenize(read)
    pos = []
    removals = ['CC', 'DT', 'FW', 'PDT', 'POS', 'PRP', 'PRP$' 'SYM', "TO", "UH" 'W', 'WDT', 'WP', 'WP$', "WRB", '$', '"', "''", "(", ")", ",", "--", ".", ":"]
    sats = ["all", "both", "each", "half", "some"]
    for w in nltk.pos_tag(readTokens): pos.append(dict(word=w[0], part=w[1]))
    for w in pos:
        if w in sats:
           w['part'] = 's'

        if w['part'] in removals:
            pos.remove(w)
        else:
            w['part'] = getWordnetPos(w['part'])
            if not w['part'].startswith('_'):
                w['word'] = lmr.lemmatize(w['word'], w['part'])
        # else:
        #     if w['part'] != '_IN':
        #         pos.remove(w)
    return pos

